import React, { Component } from 'react';
import { Link } from 'react-router-dom';
const wrapper = {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        width: '100%',
        padding: '50px',
        color: '#444',
        border: '1px solid #1890ff',
      };
class Nav extends Component {
    state = {  }
    
    render() { 
        return (
            <div style={wrapper}>
                <nav style={{color: '#0d1a26', fontWeight: 400, }}>
                    <Link>
                    <li>Home</li>
                    </Link>

                    <Link>
                    <li>About</li>
                    </Link>
                    
                    <Link>
                    <li>Resources</li>
                    </Link>

                </nav>
            </div>
          );
    }
}

export default Nav;
